(9, './image/camel.jpeg', 'Dominic Rolled Arm', 2799, 0, 'Its made with wood frame with sinuous spring and\nfoam cushions.This sofa is made in a beige polyester\nfabric with a textured crosshatch pattern, and features\nrounded arms,three removable seat cushions, solid wood\nfeet and comes with four throw pillows.'),
(10, './image/camel2.jpeg', 'Avani Rolled Arm', 2750, 0, 'Featuring a subtle camelback backrest with rolled arms,\r\nwith three-seater sofa brings an impressive modern\r\ntwist. This sofa is finished with beautifully turned\r\nwood legs and loose accent pillows, bringing stunning\r\nstyle and outstanding durability to your home.'),
(11, './image/camel3.jpeg', 'Calesta Flared Arm', 2999, 0, 'Made in the USA from solid and engineered wood.\r\nFlared arms design define this couch contemporary styles.\r\nThis includes six toss pillows for an instantly\r\ncurated look. Removable seat cushions and cushion\r\ncovers make maintenance seamless.'),
(12, './image/camel4.jpeg', 'Freda Velvet Sofa', 2799, 0, 'Classic glam style to your living room. Its made from a\r\nengineered wood, and its built on turned bun feet with\r\nan espresso finish. The rolled arms are upholstered\r\nin plush velvet and theyre filled with foam\r\nfor a supported place.'),
(13, './image/camel5.jpeg', 'Eviana Pattern Sofa', 2500, 0, ''),
(14, './image/camel6.jpeg', 'Elisa Sweet Flared Arm', 2100, 0, 'This sofa is here to anchor your living room with\r\nsome eye-catching glam style.This couch features\r\na striking camelback with channel tufting for a\r\nlook glam look with mid-century inspiration\r\nthats sure to grab glances.'),
(15, './image/camel7.jpeg', 'Moneta Wooden Leg', 1750, 0, 'The sofa is the perfect addition to any living space\r\nlooking to add a bit of a traditional flair. \r\nThe fabric selectedfor the collection features engineered for\r\nlong life. The frame provides exceptional support and stability.'),
(16, './image/camel8.jpeg', 'Chelvey Wooden Leg', 1755, 0, 'This sofa is designed with high quality material.\r\nIt is provide you a modern contemporary vibes\r\nwith modern design and wooden leg. The pattern\r\nmake it appear more stylish to your living room.');

