(9, './image/cabriole1.jpeg', 'Corbyn Loveseat Sofa', 2700, 9, 'This inviting settee takes your living room from drab to fab.\r\na sand grey finish on a robust wooden body, a green-tone upholstery \r\nwith coordinating throw pillow. Feather blend and foam reversible seat \r\ncushions elevate this settee to the next level'),
(10, './image/cabriole2.jpeg', 'Haley Cream Sofa', 2950, 10, 'Built with a solid birch wood frame and features a cabriole silhouette \r\nto its exposed frame with carved detail. The whitewash finish and turned \r\nlegs give this sofa a hint of charm.The seat and back cushions are wrapped \r\nin polyester and filled with foam and six pattern pillow.'),
(11, './image/cabriole3.jpeg', 'Jesabelle Sofa', 2411, 11, 'Its frame is wrapped in fade and stain-resistant polyester upholstery, while \r\nits seatback is accented by deep button tufts that drive home this couch’s classic \r\nappeal. The cushion density is 11.9 lb and also comes with four pillow.'),
(12, './image/cabriole4.jpeg', 'Ferranti Silver Sofa', 2450, 12, 'Founded atop splayed legs characteristic of the metalic silver retro aesthetic, \r\nthis design’s curved frame is crafted from hardwood and then wrapped in polyester\r\n blend upholstery for a look that’s both sleek and easy to clean.'),
(13, './image/cabriole5.jpeg', 'Monroe Sofa', 2312, 13, 'Creating a seating area in the master suite or rounding out the living room.\r\n It’s founded atop a solid and engineered wood frame and wrapped in 100% polyester\r\n upholstery in a neutral hue. For traditional style,come with some French country\r\n pillows.'),
(14, './image/cabriole6.jpeg', 'Cali Loveseat Sofa', 2100, 14, 'Classic design and traditional elements brings you an undeniably elegant touch to\r\n your interior space. Fabric upholstery imparts timeless style with two pillows,\r\n while high-density foam creates luxuriously comfortable seating.'),
(15, './image/cabriole7.jpeg', 'Hazel Sofa', 3000, 15, 'Its elegant design pops in adventurous pink colors\r\nand included bolster pillows. It is for the person\r\nwho appreciates vintage and appreciates a poppy, contemporary vision for their living space.'),
(16, './image/cabriole8.jpeg', 'Amarya Plain Sofa', 3000, 16, 'The elegant and soft velvet fabric is close to your skin, bringing endless comfort. \r\nThe high-density sponge cushion and high-quality spring can hold you firmly. \r\nThe solid wood structure guarantees the durability of the sofa.');

